import {makeStyles} from '@material-ui/styles'


const estilo = makeStyles({
    main:{
        display:'flex',
        flexDirection:'column',
        width:5000
    },
      carrinho: {
    display: 'flex',
    alignItems: 'flex-start',
    justifyContent: 'flex-start',
    height: 500,
    marginLeft:'70%',
    marginTop: '5%',
    borderRadius: 10,
    width: 900,
    position: 'absolute',
  },
})

export default estilo;
